import Button from "../Button/Button";
import styles from "./UserInput.module.css";
const UserInput = () => {
  const submitHandler = (e) => {
    e.preventDefault();
    console.log("clicked");
  };

  return (
    <form className={styles.input}>
      <label>Username</label>
      <input type="text" />
      <label>Text</label>
      <input type="text" />
      <Button add={submitHandler} />
    </form>
  );
};
export default UserInput;
